import React from "react";
import './Resume.css'
import Heading from "../Heading/Heading";
import education from '../../assets/Resume/education-icon.svg';
function Resume() {
    return (
        <div className='resume-container screen-container fade-in' style={{opacity: 5, transform: "translateY(1)"}}>
            <div className="resume-content">
                <Heading head ='Resume' title = 'My formal Bio Details'/>
                <div className="resume-card">
                    <div className="resume-bullets">
                        <div className="bullet-container">
                            <div className="bullet-icons"></div>
                            <div className="bullets">
                                <div className="bullet">
                                    <img className="bullet-logo" src={education} alt="B"/>
                                    <span class="bullet-label">Education</span>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="resume-bullet-details"></div>
                </div>
            </div>
        </div>
    );
}

export default Resume;
